import React from 'react';
import {HeaderPag, FooterPag, NavMenu } from "../layout/index";
import {RoutesPag} from './routes';

const Navegacion = [
    {
        "id":{
            "id":"Introduccion",
            "href":"/Introduccion"
        },
        "sub":{
            "temas":{
                "id":"hola",
                "href":"/hello"
            }
        }

    }
]

export default function Pagina(){
    return(
        <React.StrictMode>
            <div>Hola</div>
            <HeaderPag/>
            <main>
                <RoutesPag/>
            </main>
            <FooterPag/>

        </React.StrictMode>
    )

}
